import React, { useState } from "react";
import { motion } from "framer-motion";

export default function App() {
  const [url, setUrl] = useState("");
  const [loading, setLoading] = useState(false);
  const [msg, setMsg] = useState("");

  const handleDownload = async (e) => {
    e.preventDefault();
    if (!url.trim()) {
      setMsg("Please enter a YouTube URL.");
      return;
    }
    setMsg("");
    setLoading(true);

    try {
      const res = await fetch(`/api/stream?url=${encodeURIComponent(url)}`);
      if (!res.ok) throw new Error(`HTTP error! status: ${res.status}`);

      const blob = await res.blob();
      const disposition = res.headers.get("content-disposition") || "";
      const match = /filename="?([^"]+)"?/.exec(disposition);
      const filename = match && match[1] ? match[1] : "video.mp4";

      const a = document.createElement("a");
      a.href = URL.createObjectURL(blob);
      a.download = filename;
      document.body.appendChild(a);
      a.click();
      a.remove();
      URL.revokeObjectURL(a.href);
      setMsg("Download started ✔️");
    } catch (err) {
      console.error(err);
      setMsg("Download failed — check the URL and backend connection.");
    } finally {
      setLoading(false);
    }
  };

  const handlePaste = async () => {
    try {
      const text = await navigator.clipboard.readText();
      if (text) {
        setUrl(text);
        setMsg("");
      }
    } catch (err) {
      console.error("Failed to read clipboard:", err);
      setMsg("Unable to access clipboard. Please paste manually.");
    }
  };

  return (
    <div className="min-h-screen flex items-center justify-center p-4 bg-gradient-to-br from-black via-gray-900 to-black relative overflow-hidden">
      {/* Animated background gradient */}
      <div className="absolute inset-0 bg-gradient-to-br from-red-950/20 via-transparent to-red-950/20 animate-pulse"></div>

      <motion.div
        className="w-full max-w-lg relative z-10"
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.5 }}
      >
        {/* Header with Mirror Effect */}
        <div className="text-center mb-8 relative">
          <div className="relative inline-block">
            <h1 className="text-5xl font-bold text-white mb-2 relative z-10">
              <span className="text-red-600 drop-shadow-[0_0_10px_rgba(220,38,38,0.5)]">Me</span>Tube
            </h1>
            {/* Mirror Reflection */}
            <div 
              className="absolute top-full left-0 right-0 text-5xl font-bold text-white opacity-20"
              style={{
                transform: 'scaleY(-1)',
                background: 'linear-gradient(to bottom, rgba(255,255,255,0.3) 0%, transparent 100%)',
                WebkitBackgroundClip: 'text',
                WebkitTextFillColor: 'transparent',
                filter: 'blur(1px)',
                transformOrigin: 'top',
              }}
            >
              <span className="text-red-600">Me</span>Tube
            </div>
          </div>
          <p className="text-gray-400 text-sm mt-4">Download YouTube videos</p>
        </div>

        {/* Main Card with Mirror Glass Effect */}
        <div className="mirror-card bg-gradient-to-br from-gray-900/90 to-black/90 backdrop-blur-xl border border-gray-700/50 rounded-2xl p-6 shadow-2xl relative overflow-hidden">
          {/* Shimmer effect */}
          <div className="absolute inset-0 -top-1/2 -left-1/2 w-1/2 h-1/2 bg-gradient-to-br from-transparent via-white/10 to-transparent rounded-full blur-3xl animate-shimmer pointer-events-none"></div>

          {/* Reflective surface overlay */}
          <div className="absolute inset-0 bg-gradient-to-b from-transparent via-white/5 to-transparent opacity-50 pointer-events-none"></div>

          <div className="relative z-10">
            {/* Input with Paste Button */}
            <div className="relative mb-4">
              <input
                type="text"
                value={url}
                onChange={(e) => setUrl(e.target.value)}
                placeholder="Paste YouTube URL here..."
                disabled={loading}
                className="mirror-input w-full bg-black/40 backdrop-blur-sm border border-gray-600/50 rounded-lg px-4 py-3 pr-12 text-white placeholder-gray-500 focus:border-red-500/80 focus:ring-2 focus:ring-red-500/30 outline-none transition-all text-sm shadow-inner"
              />
              <button
                type="button"
                onClick={handlePaste}
                disabled={loading}
                className="absolute right-2 top-1/2 -translate-y-1/2 px-3 py-1.5 bg-gradient-to-r from-red-600 to-red-700 hover:from-red-500 hover:to-red-600 text-white text-xs font-medium rounded-md transition-all disabled:opacity-50 disabled:cursor-not-allowed shadow-lg shadow-red-600/30"
              >
                Paste
              </button>
            </div>

            {/* Download Button with Mirror Effect */}
            <button
              type="button"
              onClick={handleDownload}
              disabled={loading || !url.trim()}
              className="mirror-button w-full bg-gradient-to-r from-red-600 to-red-700 hover:from-red-500 hover:to-red-600 text-white font-medium py-3 rounded-lg transition-all disabled:bg-gray-700 disabled:cursor-not-allowed disabled:opacity-50 mb-4 relative overflow-hidden shadow-lg shadow-red-600/40"
            >
              <span className="relative z-10">
                {loading ? (
                  <span className="flex items-center justify-center gap-2">
                    <svg className="w-4 h-4 animate-spin" viewBox="0 0 24 24" fill="none">
                      <circle className="opacity-25" cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="4"></circle>
                      <path className="opacity-75" fill="currentColor" d="M4 12a8 8 0 018-8V0C5.373 0 0 5.373 0 12h4zm2 5.291A7.962 7.962 0 014 12H0c0 3.042 1.135 5.824 3 7.938l3-2.647z"></path>
                    </svg>
                    Downloading...
                  </span>
                ) : (
                  "Download"
                )}
              </span>
              {/* Mirror shine effect */}
              <div className="absolute inset-0 bg-gradient-to-r from-transparent via-white/20 to-transparent translate-x-[-100%] group-hover:translate-x-[100%] transition-transform duration-1000"></div>
            </button>

            {/* Message */}
            {msg && (
              <motion.div
                initial={{ opacity: 0, y: -10 }}
                animate={{ opacity: 1, y: 0 }}
                className={`text-xs text-center py-2 px-3 rounded-md backdrop-blur-sm ${
                  msg.includes("✔️")
                    ? "bg-green-900/30 text-green-400 border border-green-800/50"
                    : msg.includes("failed")
                    ? "bg-red-900/30 text-red-400 border border-red-800/50"
                    : "bg-blue-900/30 text-blue-400 border border-blue-800/50"
                }`}
              >
                {msg}
              </motion.div>
            )}
          </div>
        </div>

        {/* Footer with subtle reflection */}
        <div className="text-center mt-6 text-gray-500 text-xs relative">
          <span className="relative z-10">Made by <span className="text-red-600 font-medium drop-shadow-[0_0_8px_rgba(220,38,38,0.4)]">antiz</span></span>
        </div>
      </motion.div>
    </div>
  );
}
